%script

--  Find the importance of attributes that independently impact the target attribute:  POINTS_BIN

BEGIN DBMS_DATA_MINING.DROP_MODEL('AI_EXPLAIN_OUTPUT_GOOD_WINE_AI');
EXCEPTION WHEN OTHERS THEN NULL; END;

DECLARE
    V_SETLST DBMS_DATA_MINING.SETTING_LIST;
BEGIN
    V_SETLST('ALGO_NAME')        := 'ALGO_AI_MDL';
    V_SETLST('PREP_AUTO')        := 'ON';

    DBMS_DATA_MINING.CREATE_MODEL2(
        MODEL_NAME        => 'AI_EXPLAIN_OUTPUT_GOOD_WINE_AI',
        MINING_FUNCTION   => 'ATTRIBUTE_IMPORTANCE',
        DATA_QUERY        => 'SELECT * FROM WINEREVIEWS130KTARGET_V',
        SET_LIST          => V_SETLST,
        CASE_ID_COLUMN_NAME => 'ID',
        TARGET_COLUMN_NAME  => 'POINTS_BIN');
END;

%script

-- Split the data into random samples of 60% for training data (Wine2_TRAIN_DATA) for training the models and a 40% hold out sample for testing and evaluating the models (Wine2_TEST_DATA)

CREATE OR REPLACE VIEW WINE2_TRAIN_DATA AS SELECT * FROM WINEREVIEWS130KTARGET_V SAMPLE (60) SEED (1);
CREATE OR REPLACE VIEW WINE2_TEST_DATA AS SELECT * FROM WINEREVIEWS130KTARGET_V MINUS SELECT * FROM WINE2_TRAIN_DATA;

%script
-- Build a classification model and then generate a lift test result and an apply result.  

BEGIN
DBMS_DATA_MINING.DROP_MODEL('WINE_CLASS_MODEL_NB');
EXCEPTION WHEN OTHERS THEN NULL; 
END;

DECLARE
    V_SETLST DBMS_DATA_MINING.SETTING_LIST;
BEGIN
    V_SETLST('PREP_AUTO') := 'ON';
    V_SETLST('ALGO_NAME') := 'ALGO_NAIVE_BAYES';
    DBMS_DATA_MINING.CREATE_MODEL2(
        'WINE_CLASS_MODEL_NB',
        'CLASSIFICATION',
        'SELECT * FROM WINE2_TRAIN_DATA',
        V_SETLST,
        'ID',
        'POINTS_BIN');
END;

