%script

-- Drop apply result table
DROP TABLE WINE_APPLY_RESULT_NB PURGE;
DROP TABLE WINE_LIFT_TABLE_NB PURGE;

-- Score the data and compute lift
BEGIN
DBMS_DATA_MINING.APPLY('WINE_CLASS_MODEL_NB','WINE2_TEST_DATA','ID','WINE_APPLY_RESULT_NB');
DBMS_DATA_MINING.COMPUTE_LIFT('WINE_APPLY_RESULT_NB','WINE2_TEST_DATA','ID','POINTS_BIN','WINE_LIFT_TABLE_NB','GT_90_POINTS','PREDICTION','PROBABILITY',100);
END;

