%script

DROP TABLE ALL_LIFT_DATA PURGE;

CREATE TABLE ALL_LIFT_DATA (ALGO_NAME VARCHAR2(50), QUANTILE_NUMBER NUMBER, GAIN_CUMULATIVE NUMBER);
INSERT INTO ALL_LIFT_DATA (QUANTILE_NUMBER, GAIN_CUMULATIVE, ALGO_NAME) SELECT QUANTILE_NUMBER, GAIN_CUMULATIVE, CAST('ALGO_NAIVE_BAYES' AS VARCHAR(50)) AS ALGO_NAME FROM WINE_LIFT_TABLE_NB;
