INSERT INTO ALL_LIFT_DATA (QUANTILE_NUMBER, GAIN_CUMULATIVE, ALGO_NAME) SELECT QUANTILE_NUMBER, GAIN_CUMULATIVE, CAST('ALGO_RANDOM_FOREST' AS VARCHAR(50)) AS ALGO_NAME FROM WINE_LIFT_TABLE_RF;
